INSERT INTO `QuestionBundles` VALUES (15,36,'Thank you for shopping at Larson’s China. Our products are known for their modern and unique patterns and color combinations, as well as (1) _____ and strength. (2) _____ Please note, however, that repeated drops and rough handling will (3) _____ eventual breakage. We suggest you store them carefully and that you don’t use harsh chemicals, steel sponges, or (4) _____ scrubbing when cleaning them. Please visit our website at www.larsonchina.com for information about handling and care or call us at 555-1234 if you have any questions or concerns.',NULL,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(16,36,'To:Kitchen staff,office employees\r\nFrom:Manager, LarryPark\r\nDate:March 23\r\nSubject: Renovations\r\n\r\nTo all kitchen staff and Harmon employees,\r\n\r\nFrom Sunday, March 23 to Thursday, March 27, the employee cafeteria kitchens will undergo renovations as new appliances and equipment (1) _____ in to replace the old ones. \n(2) _____ Instead, the convenience shops will carry more sandwiches, prepared lunch boxes,and snacks for the employees during this time. \nThe renovations will increase the number of sinks, ovens, and stove tops so that a larger volume of meals can be provided (3) _____ the lunch and dinner rushes. \nWe apologize for the inconvenience but we hope that the changes will (4) _____ the services in the cafeteria.',NULL,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(17,36,'Entry Position: Gold & Slide Accounting Firm\r\n\r\nWe are looking for enthusiastic candidates with an educational background in finance or (1) _____. \nAll candidates should have some computer experience. \nJob experience is not (2) _____ but preferred. \nCandidates with a bilingual language ability (3) _____ favored. \nPositions include jobs in accounting, statistics, and general office assistant. \nIf you are interested, please visit our website at www.G&Saccountingfirm.com/employment for more information. \nYou can send your cover letters and resumes to Karen Hill at khill@G&S.com. \nWe will begin interviewing candidates on Monday, November 5. \n(4) _____',NULL,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15'),(18,36,'To: samsmith@digitallT.com\r\nFrom: sharronb@email.com\r\nDate: September 24\r\nSubject: Business Contract\r\n\r\nDear Mr. \nSmith,\r\nI am Sharron Biggs, CEO and founder of BiggsGraphics. \nI recently came across your advertisement (1) _____ partnership of a graphic design company for a number of your projects. \nBiggsGraphics has (2) _____ experience working with various small businesses and companies in designing advertising campaigns, logos, and websites. \n(3) _____ Our website www.biggs-graphics.com also has some information about our company. \nI’m interested in working with your company on your projects and hope we can build a beneficial partnership. \nI look forward (4) _____ your reply. \nSincerely, Sharron Biggs\r\nCEO, BiggsGraphics',NULL,NULL,'2024-11-26 12:34:15','2024-11-26 12:34:15');
