INSERT INTO `Vocabularies` VALUES (15,6,'variety',' /vəˈraɪəti/','Many different kinds\n','He resigned for a variety of reasons.\n',125,'2024-11-30 18:42:37','2024-11-30 18:42:37'),(16,6,'promise','/ˈprɑːmɪs/','to pledge to do; bring about; or provide\n','A warranty is a promise the manufacturer makes to the consumer.\n',128,'2024-11-30 18:42:37','2024-11-30 18:42:37'),(17,6,'require','/rɪˈkwaɪər/','to deem necessary or essential\n','A car warranty may require the owner to have it serviced by a certified mechanic.\n',127,'2024-11-30 18:42:37','2024-11-30 18:42:37'),(18,6,'reputation','/ˌrepjuˈteɪʃn/','the overall quality of character','Even though the salesperson showed me a product i had never heard of, I bought it because of the good reputation of the manufacturer.\n',126,'2024-11-30 18:42:37','2024-11-30 18:42:37'),(19,6,'frequently','/ˈfriːkwəntli/','occurring commonly; widespread\n','Appliances frequently come with a one-year warranty.\n',129,'2024-11-30 18:42:37','2024-11-30 18:42:37'),(20,6,'imply','/ɪmˈplaɪ/','to indicate by inference\n','The guarantee on the Walkman implied that all damages were covered under warranty for one year.\n',130,'2024-11-30 18:42:37','2024-11-30 18:42:37'),(21,6,'consider','/kənˈsɪdər/','to think about carefully\n','The customer considered buying the VCR until he learned that the warranty coverage was very limited.\n',131,'2024-11-30 18:42:37','2024-11-30 18:42:37'),(22,6,'characteristic','/ˌkærəktəˈrɪstɪk/','revealing of individual traits','The cooking pot has features characteristic of the brand, such as “stay cool\" handles.\n',132,'2024-11-30 18:42:37','2024-11-30 18:42:37'),(23,6,'consequence','/ˈkɑːnsəkwens/','revealing of individual traits\n','The cooking pot has features characteristic of the brand, such as “stay cool\" handles.\n',133,'2024-11-30 18:42:37','2024-11-30 18:42:37'),(24,6,'expiration','/ˌekspəˈreɪʃn/','the end\n','He stayed on past the expiration of his tourist visa.\n',134,'2024-11-30 18:42:37','2024-11-30 18:42:37'),(61,5,'productive','/prəˈdʌktɪv/','constructive; high yield\n','The unproductive sales meeting brought many staff complaints.\n',154,'2024-11-30 21:00:44','2024-11-30 21:00:44'),(62,5,'satisfaction','/ˌsætɪsˈfækʃn/','happiness\n','He had the satisfaction of seeing his book become a bestseller.\n',157,'2024-11-30 21:00:44','2024-11-30 21:00:44'),(63,5,'persuation','/pərˈsweɪʒn/','the power to influence; a deep conviction or belief\n','The seminar teaches techniques of persuasion to increase sales.\n',155,'2024-11-30 21:00:44','2024-11-30 21:00:44'),(64,5,'competition','/ˌkɑːmpəˈtɪʃn/','a contest or struggle\n','We are in competition with four other companies for the contract.\n',156,'2024-11-30 21:00:44','2024-11-30 21:00:44'),(65,5,'market','/ˈmɑːrkɪt/','the course of buying and selling a product; the demand for a product\n','Are you sure there\'s a market for the product?\n',158,'2024-11-30 21:00:44','2024-11-30 21:00:44'),(66,5,'attract','/əˈtrækt/','to draw by appeal\n','The display attracted a number of people at the convention.\n',159,'2024-11-30 21:00:44','2024-11-30 21:00:44'),(67,5,'consume','/kənˈsuːm/','to absorb; to use up\n','The business plans consumed all of Fritz’s attention this fall.\n',160,'2024-11-30 21:00:44','2024-11-30 21:00:44'),(68,5,'inspiration','/ˌɪnspəˈreɪʃn/','A thing or person that arouses a feeling\n','Dreams can be a rich source of inspiration for an artist.\n',161,'2024-11-30 21:00:44','2024-11-30 21:00:44'),(69,5,'compare','/kəmˈper/','to examine similarities and differences\n','Once the customer compared the two products, her choice was easy.\n',162,'2024-11-30 21:00:44','2024-11-30 21:00:44');
