CREATE DEFINER=`root`@`%` PROCEDURE `GetUserAnswers`(
	in p_userId int,
	in p_groupId int
)
BEGIN
	SELECT 
		q.id AS questionId,
		ua.answerId AS userAnswerId,
		ca.answerId AS correctAnswerId
	FROM Questions q
	LEFT JOIN UserAnswers ua
		ON q.id = ua.questionId AND ua.userId = p_userId
	LEFT JOIN CorrectAnswers ca
		ON q.id = ca.questionId
	WHERE q.groupId = p_groupId;
END ;;
